import React from 'react';
import { useState,useEffect } from "react";
import { Box, Stack } from "@mui/system";
import { Button, ButtonGroup } from "@mui/material";
import '../css/details.css';
import SendIcon from '@mui/icons-material/Send';
import Navbar from './Navbar';
const Details = () => {
    const colors=["red","blue","yellow","green","blueviolet"];
    const [preview,setPreview]=useState(colors[0]);
    const width=window.width;
    return (
        <div>  
            <Navbar/>
            <h1> Title of the Item </h1>
            <Stack direction={"row"} className="photo-list">

                <button className="items" style={{
                    backgroundColor:colors[0]
                }} onClick={()=>{
                    setPreview(colors[0]);
                }} > gett</button>
                <button className="items" style={{
                    backgroundColor:colors[1]
                }} onClick={()=>{
                    setPreview(colors[1]);
                }} > gett</button>
                <button className="items" style={{
                    backgroundColor:colors[2]
                }} onClick={()=>{
                    setPreview(colors[2]);
                }} > gett</button>
                <button className="items" style={{
                    backgroundColor:colors[3]
                }} onClick={()=>{
                    setPreview(colors[3]);
                }} > gett</button>
                <button className="items" style={{
                    backgroundColor:colors[4]
                }} onClick={()=>{
                    setPreview(colors[4]);
                }} > gett</button>
            </Stack>
            <div className="details" >
                <Stack direction={"row"}>
                <div className="bigPicture" style={{
                            backgroundColor:preview
                        }}>
                        Big Picture
                    </div>
                </Stack>
                <div className="detailWords"> 
                    <h1> HP Laptop</h1>
                    <hr></hr>
                    <br></br>
                    <p>
                    RAM : 16GB /n
                    STORAGE: 1TB Hard Disk
                    Type: HP LAPTOP 
                    CPU  :Intel core i5 dual core
                    With Graphics card
