                    maiores sequi assumenda adipisci, omnis voluptatem dolore eaque.
                    </p>
                </div>
            </div>

            <Button variant="contained" sx={{
                marginTop:"20px"
            }} endIcon={<SendIcon />}>
                Order
            </Button>
        </div>
    );
}
export default Details;
